import React from 'react';
import styled from 'styled-components';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import StoryEle from './storyEle';


function Story() {
  const setting={
    dots:true,
    sliderToShow:5,
    sliderToScroll:5,
    speed:500,
    arrow:true
  }
  return (
      <Slider {...setting}>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
          <StoryEle></StoryEle>
      </Slider>
  );
}

export default Story;
